export default function cleanSet(set, starString) {
  if (typeof starString !== 'string' || starString.length === 0 || typeof set !== 'Object') {
    return '';
  }
  for (const item in set) {
    if (item && item.startsWith(starString)) {
      str.push(item.slice(starString.length));
    }
  }
  return str.join('-');
}
